import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

function Nav() {
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>

      Navbar Here
    </Navbar>
  )
}

export default Nav;
